import { Switch, Router, Route } from "react-router";
import Home from "./pages/Home";


function Routes() {
  return(
      <div>
        <Router>
            <Switch>
                <Route exact path="/" component={Home} />
            </Switch>
        </Router>
      </div>
  );
}

export default Routes;
